var formattedEvents = [];
/*
// 'events' format
"events": {
      "eventTime": "2020-09-09T03:15:30Z",
      "id": "12345",
      "eventType": "UPDATED",
      "object": "quote"
    }
*/
var eventObj = events;

if (events) {
  //prepare formatted event body
  eventObj.event_type = events.eventType;
  eventObj.event_object_type = events.object;
  eventObj.event_object_id = events.data[Object.keys(events.data)[0]];
  eventObj.event_date = events.eventTime;
}

formattedEvents.push(eventObj);

done({
  "events": formattedEvents
});
